window.bookSummaryJSON = "The structures that lie beneath our skin represent a remarkable and beautiful assortment of biological mechanisms that are essential for our lives. However, we often take these structures for granted. <p>In these fourteen fascinating lectures from Howard University's Professor John K. Young, a basic overview of the human body, its physical features, biological systems, and general functioning will be presented for the benefit of anyone from budding medical students to curious laymen.</p> <p>In Young's lectures, he shares the knowledge he has gained during his 30-year tenure as a teacher as he leads his audience on an unforgettable journey through the wonders of the human body.</p>"; 
